import React, {useEffect} from 'react'
import MenuFablab from '../componentes/Menu'
import PagHeader from '../componentes/pagHeader'
import firebase, {  } from '../firebase'
import { Container } from 'semantic-ui-react'


function Productos() {

  useEffect(() => {
    firebase.database().ref().child("productos").orderByChild("marca").once("value", snapshot =>{
      snapshot.forEach(datos => {
        console.log("datos: " + datos)
      })
    });

  }, [])


  return (
    <div>
      <MenuFablab></MenuFablab>
      <Container>
        <PagHeader></PagHeader>
      </Container>

    </div>
  )
}

export default Productos
